Sagada () is a rural locality (a selo) in Tsuntinsky District, Republic of Dagestan, Russia. Population:  There are 3 streets in this selo.
Geography
Selo is located 145&nbsp;km from Makhachkala (capital of Dagestan) and 1,635&nbsp;km from Moscow. Metrada is the nearest rural locality.
